import React from "react";

export default class ProfilePage extends React.Component {
    constructor(props) {
        super(props);

        this.props = props;
    }

    render() {    
        return (
            <div>
                <section>
                    <p><strong>User:</strong>*{props.user.name}*</p>
                </section>
                <section>
                <p><strong>Theme:</strong>*{this.state.theme}*</p>
                </section>
            </div>
        )
    }
}
